anted to rebind C ","-- as F in input.conf:","--","-- \tF script-binding cropmode","--","-- If you use an hwdec, it will need to be of the copy variety, e.g.,","-- \thwdec=auto-copy-safe","--","-- The default step and aspect ratios can be changed via script-opts, see options below.","--","","local options = require 'mp.options'","local o = {","\tstep = 64,","\tars = {","\t\t{ 1,  1 },","\t\t{ 16, 9 },","\t\t{ 9, 16 },","\t\t{ 4,  3 },","\t\t{ 2,  3 }","\t}","}","options.read_options(o)","step,ars = o.step,o.ars","ari = 1","","-- keep x/y/w/h in the bounds of the image & initialize them if not already","local function bound()","\tiw,ih = mp.get_property_native(\"width\", 2),mp.get_property_native(\"height\", 2)","\tx=math.floor(((not x or x<0) and 0 or x))","\ty=math.floor(((not y or y<0) and 0 or y))","\tw=math.floor(((not w or w>iw) and iw or w))","\th=math.floor(((not h or h>ih) and ih or h))","\tw=(w<2 and 2 or w)","\th=(h<2 and 2 or h)","\tx=(x+w>iw and iw-w or x)","\ty=(y+h>ih and ih-h or y)","end","","local function filter() return \"crop=\"..w..\":\"..h..\":\"..x..\":\"..y end","local function jpegtran() return \"jpegtran -crop \"..w..\"x\"..h..\"+\"..x..\"+\"..y end","local function update() bound(); mp.commandv(\"vf\", \"add\", \"@crop:\"..filter()) end","","local function addw() w=w+step; x=x-step/2; update() end","local function addh() h=h+step; y=y-step/2; update() end","local function addx() x=x+step; update() end","local function addy() y=y+step; update() end","local function subw() w=w-step; x=x+step/2; update() end","local function subh() h=h-step; y=y+step/2; update() end","local function subx() x=x-step; update() end","local function suby() y=y-step; update() end","local function center() bound(); x=(iw-w)/2; y=(ih-h)/2; update() end","local function addstep() step=step+1; mp.commandv(\"show-text\", \"step: \"..step) end","local function substep() step=step-1; mp.commandv(\"show-text\", \"step: \"..step) end","local function dblstep() step=step*2; mp.commandv(\"show-text\", \"step: \"..step) end","local function hlfstep() step=step/2; mp.commandv(\"show-text\", \"step: \"..step) end","local function showaspect() mp.commandv(\"show-text\", ars[ari][1]..\":\"..ars[ari][2]) end","local function incrari() ari=(ari==#ars and 1 or ari+1); showaspect() end","local function decrari() ari=(ari==1 and #ars or ari-1); showaspect() end","local function applyaspect()","\tlocal w_ = h/ars[ari][2]*ars[ari][1]","\tlocal h_ = w/ars[ari][1]*ars[ari][2]","\tif w_ <= w then","\t\tx = x + (w - w_)/2","\t\tw = w_","\telse","\t\ty = y + (h - h_)/2","\t\th = h_","\tend","\tshowaspect()","\tupdate()","end","","local function cropmode()","\tif not mode_on then","\t\tmode_on = true","\t\tmp.commandv(\"show-text\", \"Crop mode enabled\")","\t\tx,y,w,h = nil; update();","","\t\tmp.add_forced_key_binding(\"c\",           \"center\",  center)","\t\tmp.add_forced_key_binding(\"a\",           \"dblstep\", dblstep)","\t\tmp.add_forced_key_binding(\"z\",           \"hlfstep\", hlfstep)","\t\tmp.add_forced_key_binding(\"A\",           \"addstep\", addstep, { repeatable = true })","\t\tmp.add_forced_key_binding(\"Z\",           \"substep\", substep, { repeatable = true })","\t\tmp.add_forced_key_binding(\"Ctrl+a\",      \"incrari\", incrari)","\t\tmp.add_forced_key_binding(\"Ctrl+z\",      \"decrari\", decrari)","\t\tmp.add_forced_key_binding(\"Ctrl+s\",      \"applyaspect\", function() applyaspect() end)","\t\tmp.add_forced_key_binding(\"h\",           \"subwvi\",  subw)","\t\tmp.add_forced_key_binding(\"j\",           \"addhvi\",  addh)","\t\tmp.add_forced_key_binding(\"k\",           \"subhvi\",  subh)","\t\tmp.add_forced_key_binding(\"l\",           \"addwvi\",  addw)","\t\tmp.add_forced_key_binding(\"y\",           \"subwsubhvi\",  function() subw(); subh(); end)","\t\tmp.add_forced_key_binding(\"u\",           \"addwsubhvi\",  function() addw(); subh(); end)","\t\tmp.add_forced_key_binding(\"b\",           \"subwaddhvi\",  function() subw(); addh(); end)","\t\tmp.add_forced_key_binding(\"n\",           \"addwaddhvi\",  function() addw(); addh(); end)","\t\tmp.add_forced_key_binding(\"1\",           \"subwaddhnp\", function() subw(); addh(); end)","\t\tmp.add_forced_key_binding(\"2\",           \"addhnp\",  addh)","\t\tmp.add_forced_key_binding(\"3\",           \"addwaddhnp\", function() addw(); addh(); end)","\t\tmp.add_forced_key_binding(\"4\",           \"subwnp\",  subw)","\t\tmp.add_forced_key_binding(\"5\",           \"applyaspectnp\", applyaspect)","\t\tmp.add_forced_key_binding(\"6\",           \"addwnp\",  addw)","\t\tmp.add_forced_key_binding(\"7\",           \"subwsubhnp\", function() subw(); subh(); end)","\t\tmp.add_forced_key_binding(\"8\",           \"subhnp\",  subh)","\t\tmp.add_forced_key_binding(\"9\",           \"addwsubhnp\", function() addw(); subh(); end)","\t\tmp.add_forced_key_binding(\"LEFT\",        \"subw\",    subw)","\t\tmp.add_forced_key_binding(\"DOWN\",        \"addh\",    addh)","\t\tmp.add_forced_key_binding(\"UP\",          \"subh\",    subh)","\t\tmp.add_forced_key_binding(\"RIGHT\",       \"addw\",    addw)","\t\tmp.add_forced_key_binding(\"Ctrl+h\",      \"subxvi\",  subx)","\t\tmp.add_forced_key_binding(\"Ctrl+j\",      \"addyvi\",  addy)","\t\tmp.add_forced_key_binding(\"Ctrl+k\",      \"subyvi\",  suby)","\t\tmp.add_forced_key_binding(\"Ctrl+l\",      \"addxvi\",  addx)","\t\tmp.add_forced_key_binding(\"Ctrl+y\",      \"subxsubyvi\", function() subx(); suby(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+u\",      \"addxsubyvi\", function() addx(); suby(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+b\",      \"subxaddyvi\", function() subx(); addy(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+n\",      \"addxaddyvi\", function() addx(); addy(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+1\",      \"subxaddynp\", function() subx(); addy(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+2\",      \"addynp\",  addy)","\t\tmp.add_forced_key_binding(\"Ctrl+3\",      \"addxaddynp\", function() addx(); addy(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+4\",      \"subxnp\",  subx)","\t\tmp.add_forced_key_binding(\"Ctrl+5\",      \"centernp\",  center)","\t\tmp.add_forced_key_binding(\"Ctrl+6\",      \"addxnp\",  addx)","\t\tmp.add_forced_key_binding(\"Ctrl+7\",      \"subxsubynp\", function() subx(); suby(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+8\",      \"subynp\",  suby)","\t\tmp.add_forced_key_binding(\"Ctrl+9\",      \"addxsubynp\", function() addx(); suby(); end)","\t\tmp.add_forced_key_binding(\"Ctrl+LEFT\",   \"subx\",    subx)","\t\tmp.add_forced_key_binding(\"Ctrl+DOWN\",   \"addy\",    addy)","\t\tmp.add_forced_key_binding(\"Ctrl+UP\",     \"suby\",    suby)","\t\tmp.add_forced_key_binding(\"Ctrl+RIGHT\",  \"addx\",    addx)","\telse","\t\tmode_on = false","\t\tprint(jpegtran()); mp.commandv(\"show-text\", jpegtran());","\t\tprint(filter()); mp.commandv(\"show-text\", filter());","\t\tmp.commandv(\"vf\", \"remove\", \"@crop\")","","\t\tlocal binds = { \"center\", \"dblstep\", \"hlfstep\", \"addstep\", \"substep\", \"incrari\", \"decrari\", \"applyaspect\", \"subwvi\", \"addhvi\", \"subhvi\", \"addwvi\", \"subwsubhvi\", \"addwsubhvi\", \"subwaddhvi\", \"addwaddhvi\", \"subwaddhnp\", \"addhnp\", \"addwaddhnp\", \"subwnp\", \"applyaspectnp\", \"addwnp\", \"subwsubhnp\", \"subhnp\", \"addwsubhnp\", \"subw\", \"addh\", \"subh\", \"addw\", \"subxvi\", \"addyvi\", \"subyvi\", \"addxvi\", \"subxsubyvi\", \"addxsubyvi\", \"subxaddyvi\", \"addxaddyvi\", \"subxaddynp\", \"addynp\", \"addxaddynp\", \"subxnp\", \"centernp\", \"addxnp\", \"subxsubynp\", \"subynp\", \"addxsubynp\", \"subx\", \"addy\", \"suby\", \"addx\" }","\t\tfor k,v in pairs(binds) do","\t\t\tmp.remove_key_binding(v)","\t\tend","\tend","end","","mode_on = false","mp.add_key_binding(\"C\", \"cropmode\", cropmode)"],"stylingDirectives":[[{"start":0,"end":65,"cssClass":"pl-c"},{"start":0,"end":2,"cssClass":"pl-c"}],[{"start":0,"end":2,"cssClass":"pl-c"},{"sta